Why not just call setTarget then set _locked = true?
```
void Fan::lockTarget(uint64_t target)
{
    setTarget(target)
    _locked = true;
}
```

For our use-case, this is fine...but we should consider how to handle more than one requests to lock the same fan like on a first-in-first-out request basis or another option?

After a fan has been unlocked, it needs to re-set its target back to the current target that's set on the zone its included in. Requires invention of setting a reference to the zone object on the fan object at the time the Fan object is added to the zone (in Manager::load())?

But then could do this:
```
void Fan::unlockTarget()
{
    _locked = false;
    setTarget(_zone.getTarget());
}
```
